import React from 'react'
import { Card } from 'react-bootstrap'
import { Link } from 'react-router-dom'

interface LevelButtonProps {
  sectionID: number
  levelID: number
  isAvailable: boolean
}

export const LevelButton = ({
  sectionID,
  levelID,
  isAvailable,
}: LevelButtonProps): JSX.Element => {

  const link = "/level/" + sectionID + "/" + levelID
  return (
    <Link to={link}>
      <div style={{ 
        width: '8rem', 
        height: '4rem', 
        padding: '5px', 
        marginBottom: '30px', 
        marginLeft: '70px', 
        marginRight: '70px', 
        textAlign: 'center',
        verticalAlign: 'center',
        borderStyle: "solid",
        borderWidth: "2px 2px 2px 2px",
        backgroundColor: isAvailable ? "white" : "grey"
      }}
      >
          <h1>{levelID}</h1>
      </div>
    </Link>
  )
}
